  CheckMark,
  Input,
} from './styles';

const Filter = () => (
  <ContainerFilter>
    <ContainerPrice>
      <TitlePrice>Pre√ßos</TitlePrice>
      <Container>
        <SubtitlePrice>One</SubtitlePrice>
